      <p className="text-gray-600 mt-2 mb-5">{description}</p>
      <div className="space-x-5">
     
      <i className="fa-solid fa-trash" onClick={()=>{deletenotes(note._id)}}></i>
      <i className="fa-solid fa-file-pen"></i>
      </div>
    </div>
  );
}
